2 sc0 ls0">L</div><div class="t m43 xc h45 y44 ff2 fs43 fc2 sc0 ls0 ws0"> </div><div class="t m44 xc h46 y45 ff2 fs44 fc2 sc0 ls0">T</div><div class="t m45 xd h47 y46 ff2 fs45 fc2 sc0 ls0">O</div><div class="t m46 xd h48 y47 ff2 fs46 fc2 sc0 ls0">G</div><div class="t m47 xe h49 y48 ff2 fs47 fc2 sc0 ls0">E</div><div class="t m48 x1d h4a y49 ff2 fs48 fc2 sc0 ls0">T</div><div class="t m49 x1d h4b y4a ff2 fs49 fc2 sc0 ls0">H</div><div class="t m4a x1c h4c y4b ff2 fs4a fc2 sc0 ls0">E</div><div class="t m4b x1b h4d y4c ff2 fs4b fc2 sc0 ls0">R</div><div class="t m4c x1a h4e y4d ff2 fs4c fc2 sc0 ls0 ws0"> </div><div class="t m4d x1f h4f y4e ff3 fs4d fc1 sc0 ls2 ws2">&lt;&lt;&lt;SA<span class="_ _0"></span>VEI&gt;&gt;&gt;&gt;D<span class="_ _1"></span>A<span class="_ _0"></span>TE&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;</div><div class="t m4d x20 h4f y4e ff3 fs4d fc1 sc0 ls8 ws3">CONFRIM&gt;&gt;&gt;ASISST<span class="_ _0"></span>ANCE&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;</div><div class="t m4e x21 h4f y4f ff3 fs4d fc1 sc0 ls2 ws2">&lt;&lt;&lt;SA<span class="_ _0"></span>VEI&gt;&gt;&gt;&gt;D<span class="_ _1"></span>A<span class="_ _0"></span>TE&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;</div><div class="t m4e x22 h4f y4f ff3 fs4d fc1 sc0 ls8 ws3">CONFRIM&gt;&gt;&gt;ASISST<span class="_ _0"></span>ANCE&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;</div><div class="t m4f x23 h50 y50 ff4 fs4e fc3 sc0 ls0 ws0">Prisca <span class="ff5">&amp;</span> Simon</div><div class="t m0 x24 h51 y51 ff6 fs4f fc4 sc0 ls0 ws0">Le samedi 27 juillet 2024</div><div class="t m0 x25 h51 y52 ff6 fs4f fc4 sc0 ls0 ws0">à 13 heures, deux étoiles vont s’unir sous les cieux de </div><div class="t m0 x26 h51 y53 ff6 fs4f fc4 sc0 ls0 ws0">la belle ville de Makénéné et de sa paroisse St-Joseph. </div><div class="t m0 x26 h51 y54 ff6 fs4f fc4 sc0 ls0 ws0">Leur amour brille de mille feux et ils veulent le graver </div><div class="t m0 x23 h51 y55 ff6 fs4f fc4 sc0 ls0 ws0">à jamais dans leur cœur et dans leur essence.</div><div class="t m0 x27 h51 y56 ff6 fs4f fc4 sc0 ls0 ws0">vous invitent à partager cette féerie de l’amour avec </div><div class="t m0 x26 h51 y57 ff6 fs4f fc4 sc0 ls0 ws0">eux. Les réjouissances se poursuivront à leur domicile </div><div class="t m0 x28 h51 y58 ff6 fs4f fc4 sc0 ls0 ws0">le même jour au quartier Carrière à partir de 16h </div><div class="t m0 x29 h51 y59 ff6 fs4f fc4 sc0 ls0 ws4">précises.</div><div class="t m0 x25 h51 y5a ff6 fs4f fc4 sc0 ls0 ws0">Mais avant, ils vont communier avec les ancêtres par </div><div class="t m0 x25 h51 y5b ff6 fs4f fc4 sc0 ls0 ws0">la cérémonie de la dot le vendredi 26 juillet 2024 dès </div><div class="t m0 x28 h51 y5c ff6 fs4f fc4 sc0 ls0 ws0">16h, au domicile des parents de Prisca au quartier </div><div class="t m0 x2a h51 y5d ff6 fs4f fc4 sc0 ls0 ws0">Hôpital de Makénéné.</div><div class="t m0 x26 h51 y5e ff6 fs4f fc4 sc0 ls0 ws0">Nous espérons que vous accepterez d’être les témoins </div><div class="t m0 x25 h51 y5f ff6 fs4f fc4 sc0 ls0 ws0">de la concrétisation de cet amour, drapé d’une tenue </div><div class="t m0 x2b h51 y60 ff6 fs4f fc4 sc0 ls0 ws0">chic et glamour.</div><div class="t m0 x28 h51 y61 ff6 fs4f fc4 sc0 ls0 ws0">Pour la circonstance, veuillez laisser vos appareils </div><div class="t m0 x28 h51 y62 ff6 fs4f fc4 sc0 ls0 ws0">photos dans le fond de vos poches et vos sacoches, </div><div class="t m0 x2c h51 y63 ff6 fs4f fc4 sc0 ls0 ws0">puisqu’ils ont prévu un photographe pour vous </div><div class="t m0 x28 h51 y64 ff6 fs4f fc4 sc0 ls0 ws0">permettre de profiter pleinement de la cérémonie.</div><div class="t m0 x2d h51 y65 ff6 fs4f fc4 sc0 ls0 ws0">Pour que tout soit parfait dans les moindres détails, les </div><div class="t m0 x28 h51 y66 ff6 fs4f fc4 sc0 ls0 ws0">amoureux ont besoin d’une réponse avant le 01er </div><div class="t m0 x2e h51 y67 ff6 fs4f fc4 sc0 ls0 ws4">juillet.</div><div class="t m0 x2f h52 y68 ff6 fs50 fc4 sc0 ls3">MARIAGE</div><div class="t m0 x8 h52 y69 ff6 fs50 fc4 sc0 ls3 ws0">Code:P &amp; S</div><div class="t m0 x30 h53 y6a ff6 fs51 fc4 sc0 ls4 ws0">PASSEPORT No.:</div><div class="t m0 x1b h53 y6b ff6 fs51 fc4 sc0 ls5">2024</div><div class="t m0 x8 h52 y6c ff6 fs50 fc4 sc0 ls3">INVITÉ(E):</div><div class="t m0 x31 h53 y6d ff6 fs51 fc4 sc0 ls0">{{$name ?? '...................................................................'}}</div><div class="t m0 x32 h52 y6e ff6 fs50 fc4 sc0 ls3 ws0">NOMBRE DE PERSONNES:</div><div class="t m0 x33 h53 y6f ff6 fs51 fc4 sc0 ls0">{{$seats ?? '............................................'}}</div><div class="t m0 x1e h53 y70 ff6 fs51 fc4 sc0 ls5">DATE:</div><div class="t m0 x34 h53 y71 ff6 fs51 fc4 sc0 ls5 ws0">Samedi 27 juillet 2024</div><div class="t m0 x2f h53 y72 ff6 fs51 fc4 sc0 ls5">HEURE:</div><div class="t m0 xd h53 y73 ff6 fs51 fc4 sc0 ls5 ws0">1 p.m.</div><div class="t m0 x1c h52 y74 ff6 fs50 fc4 sc0 ls3">LIEU:</div><div class="t m0 x35 h53 y75 ff6 fs51 fc4 sc0 ls5">MAKÉNÉNÉ</div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf3" class="pf w0 h0" data-page-no="3"><div class="pc pc3 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x2c h54 y76 ff6 fs52 fc3 sc0 ls0 ws0">Conformément au plan divin qui nous a </div><div class="t m0 x36 h54 y77 ff6 fs52 fc3 sc0 ls0 ws0">réunis, nous invitons avec joie notre </div><div class="t m0 x37 h54 y78 ff6 fs52 fc3 sc0 ls0 ws0">famille et nos amis bien-aimés</div><div class="t m0 x38 h54 y79 ff6 fs52 fc3 sc0 ls0 ws0">à témoigner et à célébrer l’union de nos </div><div class="t m0 x36 h54 y7a ff6 fs52 fc3 sc0 ls0 ws0">cœurs. Votre présence rendra notre </div><div class="t m0 x39 h54 y7b ff6 fs52 fc3 sc0 ls0 ws0">journée encore plus bénie et complète.</div><div class="t m0 x3a h54 y7c ff6 fs52 fc3 sc0 ls0 ws0">Rejoignez-nous alors que nous </div><div class="t m0 x3b h54 y7d ff6 fs52 fc3 sc0 ls0 ws0">commençons notre voyage ensemble, </div><div class="t m0 x2c h54 y7e ff6 fs52 fc3 sc0 ls0 ws0">entourés de l&apos;amour et du soutien de nos </div><div class="t m0 x3c h54 y7f ff6 fs52 fc3 sc0 ls0 ws9">proches.</div><div class="t m4e x3d h4f y4f ff3 fs4d fc1 sc0 ls2 ws2">&lt;&lt;&lt;SA<span class="_ _0"></span>VEI&gt;&gt;&gt;&gt;D<span class="_ _1"></span>A<span class="_ _0"></span>TE&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;</div><div class="t m4e x3e h4f y4f ff3 fs4d fc1 sc0 ls8 ws3">CONFRIM&gt;&gt;&gt;ASISST<span class="_ _0"></span>ANCE&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;</div><div class="t m4d x20 h4f y80 ff3 fs4d fc1 sc0 ls2 ws2">&lt;&lt;&lt;SA<span class="_ _0"></span>VEI&gt;&gt;&gt;&gt;D<span class="_ _1"></span>A<span class="_ _0"></span>TE&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;</div><div class="t m4d x3f h4f y80 ff3 fs4d fc1 sc0 ls8 ws3">CONFRIM&gt;&gt;&gt;ASISST<span class="_ _0"></span>ANCE&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;</div><div class="t m4f x40 h50 y81 ff4 fs4e fc3 sc0 ls0 ws0">Prisca <span class="ff5">&amp;</span> Simon</div><div class="t m0 x1 h51 y82 ff6 fs4f fc4 sc0 ls0 ws0">On Saturday July 27, 2024 at 1 p.m., two stars will </div><div class="t m0 x40 h51 y83 ff6 fs4f fc4 sc0 ls0 ws0">unite under the skies of the beautiful town of </div><div class="t m0 x41 h51 y84 ff6 fs4f fc4 sc0 ls0 ws0">Makénéné and its parish of St-Joseph. Their love </div><div class="t m0 x31 h51 y85 ff6 fs4f fc4 sc0 ls0 ws0">shines brightly and they want to engrave it forever in </div><div class="t m0 x42 h51 y86 ff6 fs4f fc4 sc0 ls0 ws0">their hearts and in their essence.</div><div class="t m0 x31 h51 y87 ff6 fs4f fc4 sc0 ls0 ws0">invite you to share this magic of love with them. The </div><div class="t m0 x43 h51 y88 ff6 fs4f fc4 sc0 ls0 ws0">celebrations will continue at their home the same day </div><div class="t m0 x44 h51 y89 ff6 fs4f fc4 sc0 ls0 ws0">in the Carrière district from 4 p.m. sharp.</div><div class="t m0 x45 h51 y8a ff6 fs4f fc4 sc0 ls0 ws0">But first, they will commune with their ancestors </div><div class="t m0 x46 h51 y8b ff6 fs4f fc4 sc0 ls0 ws0">through the dowry ceremony on Friday July 26, 2024, </div><div class="t m0 x45 h51 y8c ff6 fs4f fc4 sc0 ls0 ws0">at the home of Prisca&apos;s parents in the Makénéné </div><div class="t m0 x47 h51 y8d ff6 fs4f fc4 sc0 ls0 ws0">Hospital district.</div><div class="t m0 x48 h51 y8e ff6 fs4f fc4 sc0 ls0 ws0">We hope that you will agree to be witnesses to the </div><div class="t m0 x40 h51 y8f ff6 fs4f fc4 sc0 ls0 ws0">realization of this love, draped in a chic and</div><div class="t m0 x33 h51 y90 ff6 fs4f fc4 sc0 ls0 ws0">glamorous outfit.</div><div class="t m0 x1 h51 y91 ff6 fs4f fc4 sc0 ls0 ws0">For the occasion, please leave your cameras in the </div><div class="t m0 x46 h51 y92 ff6 fs4f fc4 sc0 ls0 ws0">bottom of your pockets and your bags, since they have </div><div class="t m0 x49 h51 y93 ff6 fs4f fc4 sc0 ls0 ws0">provided a photographer to allow you to fully enjoy </div><div class="t m0 x4a h51 y94 ff6 fs4f fc4 sc0 ls0 ws0">the ceremony.</div><div class="t m0 x31 h51 y95 ff6 fs4f fc4 sc0 ls0 ws0">To ensure everything is perfect down to the smallest </div><div class="t m0 x40 h51 y96 ff6 fs4f fc4 sc0 ls0 ws0">detail, lovers need a response before July 1st.</div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf4" class="pf w2 h55" data-page-no="4"><div class="pc pc4 w2 h55"><img class="bi x0 y0 w3 h56" alt="" src="data:image/png;base64,"/><div class="t m0 x4b h57 y97 ff7 fs53 fc0 sc0 lsa ws0">CARTE D&apos;EMBARQUEMENT</div><div class="t m0 x4b h58 y98 ff3 fs54 fc0 sc0 lsb">................................................................................</div><div class="t m4d x4c h59 y99 ff8 fs55 fc3 sc0 lsc">.......................</div><div class="t m0 x4d h52 y9a ff6 fs50 fc4 sc0 ls0 ws0">Veuillez apporter </div><div class="t m0 x4e h52 y9b ff6 fs50 fc4 sc0 ls0 ws0">cette carte avec vous</div><div class="t m0 x4f h5a y9c ff8 fs50 fc3 sc0 ls9 ws0">CODE NO.</div><div class="t m0 x3f h53 y9d ff6 fs51 fc4 sc0 ls0 ws0">POUR LA CÉRÉMONIE DE MARIAGE DE</div><div class="t m0 x34 h53 y9e ff6 fs51 fc4 sc0 ls0 ws0">Votre présence et vos prières sont très importantes pour nous</div><div class="t m0 x50 h5b y9f ff6 fs56 fc4 sc0 ls0 ws0">Samedi 27 juillet 2024</div><div class="t m0 x50 h5b ya0 ff6 fs56 fc4 sc0 ls0 ws0">St - Joseph Parish of Makénéné</div><div class="t m0 x50 h5b ya1 ff6 fs56 fc4 sc0 ls0 ws0">at 1 p.m.</div><div class="t m0 x51 h5b y9f ff6 fs56 fc4 sc0 ls0 ws0">Vendredi 26 juillet 2024</div><div class="t m0 x51 h5b ya0 ff6 fs56 fc4 sc0 ls0 ws0">Home of Prisca&apos;s parents in the hospital area</div><div class="t m0 x51 h5b ya1 ff6 fs56 fc4 sc0 ls0 ws0">in Makénéné at 4 p.m.</div><div class="t m4f x52 h5c ya2 ff4 fs57 fc3 sc0 ls0 ws0">Prisca <span class="ff5">&amp;</span> Simon</div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
